import { useState } from "react";
import Layout from "../layout";

function Checkout() {
  const [activeIndex, setActiveIndex] = useState(0);

  return (
    <Layout>
      <div className="w-2/4 m-auto pt-10">
        {["Delivery", "Shipping", "Billing", "Payment"].map((item, index) => (
          <div key={index} onClick={() => setActiveIndex(index)}>
            <hr className="h-px my-4 bg-gray-200" />
            <h3
              className={`text-xl font-medium mb-8 ${
                activeIndex === index ? "text-gray-900" : "text-gray-500"
              }`}
            >
              {item}
            </h3>
            {item === "Delivery" ? (
              <Delivery />
            ) : item === "Shipping" ? (
              <Shipping />
            ) : item === "Billing" ? (
              <Billing />
            ) : (
              <Payment />
            )}
          </div>
        ))}
      </div>
    </Layout>
  );
}

function Delivery() {
  const [boolean, setBoolean] = useState(false);
  return (
    <div>
      <h4 className="font-medium">Enter your name and address:</h4>
      <div className="*:block *:w-full *:border *:border-gray-300 *:rounded-md *:p-4 *:mt-4">
        <input className="hover:border-gray-700" placeholder="First Name" />
        <input className="hover:border-gray-700" placeholder="Last Name" />
        <input className="hover:border-gray-700" placeholder="Address" />
      </div>
      <h4 className="font-medium mt-10">What's your contact information?</h4>
      <div className="*:block *:w-full *:border *:border-gray-300 *:rounded-md *:p-4 *:mt-4">
        <input className="hover:border-gray-700" placeholder="Email" />
        <input className="hover:border-gray-700" placeholder="Phone Number" />
      </div>
      <div className="flex flex-col gap-2 mt-8 *:border *:border-gray-700 *:rounded-3xl *:py-3 *:font-medium">
        <button
          onClick={() => setBoolean(true)}
          className="bg-gray-800 text-white"
        >
          Continue
        </button>
      </div>
    </div>
  );
}

function Shipping() {
  return (
    <div>
      <h4>Shipping content goes here</h4>
    </div>
  );
}

function Billing() {
  return (
    <div>
      <h4>Billing content goes here</h4>
    </div>
  );
}

function Payment() {
  return (
    <div>
      <h4>Payment content goes here</h4>
    </div>
  );
}

export default Checkout;
